<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Underordered List</title>
</head>

<body>
    <h3>Grocery List</h3>
    <ul type="circle">
        <li>Bread</li>
        <li>Eggs</li>
        <li>Chese</li>
    </ul>

    <ul type="square">
        <li>Bread</li>
        <li>Eggs</li>
        <li>Chese</li>
    </ul>

    <ul type="none">
        <li>Bread</li>
        <li>Eggs</li>
        <li>Chese</li>
    </ul>

    <ul type="dics">
        <li>Bread</li>
        <li>Eggs</li>
        <li>Chese</li>
    </ul>
</body>

</html>
